import React from 'react';

const About = () => {
  return (
    <section id="aboutus" className="container">
      <div style={{ textAlign: 'center', maxWidth: '800px', margin: '0 auto' }}>
        <h2>Who We Are</h2>
        <h3 style={{ color: '#2ecc71', marginBottom: '20px' }}>A Software Development Company</h3>
        <p style={{ fontSize: '1.1rem', color: '#555', marginBottom: '20px' }}>
          At Techverge Solutions, we craft powerful digital experiences. We specialize in custom websites, 
          mobile apps, and scalable platforms.
        </p>
        <p style={{ color: '#666' }}>
          With a focus on clean design and smart development, our team turns complex ideas into seamless solutions. 
          We collaborate with startups and enterprises worldwide to build technology that delivers real impact.
        </p>
      </div>
    </section>
  );
};

export default About;
